import React from 'react';
import styled from 'styled-components';

const StyledControl = styled.div`
  padding: 10px;
  cursor: pointer;
  color: white;
`;

const Control = (props) => {
  const {direction, onControlClick} = props;

  return (
    <StyledControl onClick={onControlClick}>{direction}</StyledControl>
  )

}

export default Control;
